('', 'MMA-5 (ENGINEERING 1956)', 'NCR', 'NCR - MANILA, FIRST DISTRICT', 'QUEZON CITY', 'DILIMAN', '0000-00-00', 'LUZON', 14, 39, 28.400070, 121, 4, 6.260770, 1620956.371, 507368.371, 3.0, '0000-00-00', 1, 'PRS92', 'NAMRIA', 1, '0000-00-00', 1, 1956, 1, '0000-00-00', 0, 90.871, 1, 0, 10, 'NAMRIA', 121, 4, 11.149400, 14, 39, 22.974510, 14.656382, 121.069764, 134.413, 'MMA-5 = \"ENGINEERING 1956\" In Diliman, Quezon City inside the Univ. of the Philippines at the center of the deck roof of the kidney-shape elevator penthouse, at the E wing of the Engineering building. Station mark is a regular PC & GS triangulation disk embedded on the concrete roof of the Engineering Bldg. with inscription \"ENGINEERING 1956\". Latitude is 14° 39\' 28.39\" and the longitude is 121° 04\' 06.187\". Reference mark no. 1 is a drill hole with three rays, chiseled around it on the concrete curve of the deck roof, 2.7990 m. N 41° W from the station. Reference mark No. 2 is a similar marker, 3.872 m., N 88° E from the station. Reference mark no. 3 is a similar marker, 2.578 m., S 39° W from the station.', 'Aila Leana Sampana', 1, 0, '90.365M EGM2008', '0000-00-00 00:00:00', 291975.356, 1621275.457, 51, 292122.987, 1621207.085, 51, 0.0, 0.000, 0.000, 0, 0, 0.000000, 0, 0, 0.000000, 0.000, 0.000, 0.000, 14.657889, 121.068406, 0, 0.00),
