('', 'MMA-50', 'NCR', 'NCR - MANILA, FIRST DISTRICT', 'MANILA', 'SOUTH HARBOR', '0000-00-00', 'LUZON', 14, 35, 40.246240, 120, 57, 42.355690, 1613944.102, 495880.361, 3.0, '0000-00-00', 1, 'PRS92', 'NAMRIA', 3, '0000-00-00', 2, 1996, 7, '0000-00-00', 0, 2.987, 1, 0, 10, 'NAMRIA', 120, 57, 47.250350, 14, 35, 34.826710, 14.593007, 120.963125, 46.450, 'MMA-50 Is in the vicinity of the Manila South Harbor, inside the compound of the Bureau of Coast and Geodetic Survey (BCGS) opposite the Bataan Shipyard and Eng. Corp. (BASECO) compound and the NFA bagging terminal. It is about 100 m. S of the centerline of the road going to the BASECO compound and about 3.6 m. NE of the concrete hollow block perimeter fence of the compound in between two coconut trees. It is almost at the center surface of the square concrete foundation measuring 1.54 m. and 1.36 m., respectively on its side. Mark is a drilled hole 1 cm. in dia. and 2 cm. deep inscribed in a triangle engraved on the surface of the concrete foundation. No inscription. ACCESS: From the Anda circle facing the BIR bldg., travel NW along Bonifacio Drive for about 0.45 km. Then turn right on the road and pass underneath Roxas (Delpan Bridge). Follow the road and heads W towards the BASECO compound. Then stop at the foot of the bridge before entering BASECO compound and walk S for about 100 m. inside the BCGS compound.', 'Jay Cepe', 1, 0, '3.477 M EGM2008', '0000-00-00 00:00:00', 280423.473, 1614363.269, 51, 280571.414, 1614294.608, 51, 0.0, 0.000, 0.000, 0, 0, 0.000000, 0, 0, 0.000000, 0.000, 0.000, 0.000, 14.594513, 120.961765, 1, 0.00),
